const CELL_SIZE = 14;
const PADDING = 30;
const CANVAS_W = GRID_DATA.grid.ncols * CELL_SIZE + PADDING * 2;
const CANVAS_H = GRID_DATA.grid.nrows * CELL_SIZE + PADDING * 2;

const kmToPx = (xKm, yKm) => ({
  px: (xKm - GRID_DATA.grid.xmin) * CELL_SIZE + PADDING,
  py: (GRID_DATA.grid.ymin + GRID_DATA.grid.nrows - yKm) * CELL_SIZE + PADDING,
});

const pointInRing = (px, py, ring) => {
  let inside = false;
  for (let i = 0, j = ring.length - 1; i < ring.length; j = i++) {
    const xi = ring[i][0], yi = ring[i][1], xj = ring[j][0], yj = ring[j][1];
    if ((yi > py) !== (yj > py) && px < (xj - xi) * (py - yi) / (yj - yi) + xi) inside = !inside;
  }
  return inside;
};

const e = React.createElement;
const { useState, useMemo, useRef, useEffect } = React;

function App() {
  const [tempTh, setTempTh] = useState(96.7);
  const [canMin, setCanMin] = useState(30);
  const [canMax, setCanMax] = useState(70);
  const [impTh, setImpTh] = useState(79);
  const [hovered, setHovered] = useState(null);
  const [showRef, setShowRef] = useState(true);
  const [showTracts, setShowTracts] = useState(true);
  const canvasRef = useRef(null);

  const stats = useMemo(() => {
    const m = { a3: 0, tc: 0, ti: 0, ci: 0, tv: 0 };
    GRID_DATA.cells.forEach(c => {
      const mt = c.t != null && c.t >= tempTh;
      const mc = c.cn != null && c.cn >= canMin && c.cn <= canMax;
      const mi = c.im != null && c.im >= impTh;
      if (c.t != null && c.cn != null && c.im != null) m.tv++;
      if (mt && mc && mi) m.a3++; else if (mt && mc) m.tc++; else if (mt && mi) m.ti++; else if (mc && mi) m.ci++;
    });
    return m;
  }, [tempTh, canMin, canMax, impTh]);

  const getColor = (c) => {
    const mt = c.t != null && c.t >= tempTh;
    const mc = c.cn != null && c.cn >= canMin && c.cn <= canMax;
    const mi = c.im != null && c.im >= impTh;
    if (c.t == null && c.cn == null && c.im == null) return '#ffffff';
    if (mt && mc && mi) return '#dc2626';
    if (mt && mc) return '#ea580c';
    if (mt && mi) return '#7c3aed';
    if (mc && mi) return '#2563eb';
    return '#d1d5db';
  };

  const drawPath = (ctx, pts) => {
    if (pts.length < 2) return;
    const p0 = kmToPx(pts[0][0], pts[0][1]);
    ctx.moveTo(p0.px, p0.py);
    for (let i = 1; i < pts.length; i++) { const p = kmToPx(pts[i][0], pts[i][1]); ctx.lineTo(p.px, p.py); }
  };

  useEffect(() => {
    const canvas = canvasRef.current; if (!canvas) return;
    const ctx = canvas.getContext('2d');
    canvas.width = CANVAS_W; canvas.height = CANVAS_H;
    ctx.fillStyle = '#f3f4f6'; ctx.fillRect(0, 0, CANVAS_W, CANVAS_H);

    // River
    if (showRef && REF_DATA.landmarks && REF_DATA.landmarks['Mississippi_River']) {
      ctx.save(); ctx.strokeStyle = '#4A90D9'; ctx.globalAlpha = 0.7; ctx.lineWidth = 4; ctx.lineJoin = 'round';
      ctx.beginPath(); drawPath(ctx, REF_DATA.landmarks['Mississippi_River']); ctx.stroke(); ctx.restore();
    }
    // Highways
    if (showRef && REF_DATA.landmarks) {
      ctx.save();
      [['I-40',null,'I-40'],['I-55',null,'I-55'],['I-240_Loop',[4,4],'I-240']].forEach(([key,dash,label]) => {
        const pts = REF_DATA.landmarks[key]; if (!pts || pts.length < 2) return;
        ctx.strokeStyle = '#ff9500'; ctx.lineWidth = dash ? 2 : 2.5; ctx.setLineDash(dash || []);
        ctx.beginPath(); drawPath(ctx, pts); ctx.stroke();
        const mid = kmToPx(pts[Math.floor(pts.length/2)][0], pts[Math.floor(pts.length/2)][1]);
        ctx.fillStyle = '#ff9500'; ctx.font = 'bold 10px Arial'; ctx.textAlign = 'center';
        ctx.fillText(label, mid.px, mid.py - 8);
      });
      ctx.setLineDash([]); ctx.restore();
    }
    // Lat/lon
    if (showRef && REF_DATA.lat_lines) {
      ctx.save(); ctx.strokeStyle = '#ccc'; ctx.lineWidth = 0.5; ctx.setLineDash([3,3]);
      [...REF_DATA.lat_lines, ...(REF_DATA.lon_lines||[])].forEach(l => {
        if (l.pts.length < 2) return; ctx.beginPath(); drawPath(ctx, l.pts); ctx.stroke();
      });
      ctx.setLineDash([]); ctx.restore();
    }

    // Census tracts (behind grid)
    if (showTracts) {
      ctx.save(); ctx.strokeStyle = '#444'; ctx.lineWidth = 0.9; ctx.globalAlpha = 0.5;
      TRACT_DATA.forEach(t => { t.r.forEach(ring => { if (ring.length<3) return; ctx.beginPath(); drawPath(ctx,ring); ctx.closePath(); ctx.stroke(); }); });
      ctx.globalAlpha = 0.4; ctx.fillStyle = '#222'; ctx.font = '7px Arial'; ctx.textAlign = 'center'; ctx.textBaseline = 'middle';
      TRACT_DATA.forEach(t => { const p = kmToPx(t.c[0],t.c[1]); if (p.px>PADDING && p.px<CANVAS_W-PADDING && p.py>PADDING && p.py<CANVAS_H-PADDING) ctx.fillText(t.n, p.px, p.py); });
      ctx.restore();
    }

    // Grid cells
    GRID_DATA.cells.forEach(cell => {
      const px = PADDING + cell.c * CELL_SIZE;
      const py = PADDING + (GRID_DATA.grid.nrows - 1 - cell.r) * CELL_SIZE;
      ctx.fillStyle = getColor(cell); ctx.globalAlpha = 0.72;
      ctx.fillRect(px, py, CELL_SIZE, CELL_SIZE);
      ctx.globalAlpha = 1; ctx.strokeStyle = '#e5e7eb'; ctx.lineWidth = 0.3;
      ctx.strokeRect(px, py, CELL_SIZE, CELL_SIZE);
    });

    // Tract outlines over grid
    if (showTracts) {
      ctx.save(); ctx.strokeStyle = '#222'; ctx.lineWidth = 0.5; ctx.globalAlpha = 0.28;
      TRACT_DATA.forEach(t => { t.r.forEach(ring => { if (ring.length<3) return; ctx.beginPath(); drawPath(ctx,ring); ctx.closePath(); ctx.stroke(); }); });
      ctx.restore();
    }

    // Axis labels
    ctx.save(); ctx.fillStyle = '#666'; ctx.font = '9px Arial'; ctx.textAlign = 'center';
    for (let c = 0; c <= GRID_DATA.grid.ncols; c += 5) { ctx.fillText((GRID_DATA.grid.xmin+c)+' km', PADDING+c*CELL_SIZE, CANVAS_H-8); }
    ctx.textAlign = 'right';
    for (let r = 0; r <= GRID_DATA.grid.nrows; r += 5) { ctx.fillText((GRID_DATA.grid.ymin+r)+' km', PADDING-5, PADDING+(GRID_DATA.grid.nrows-r)*CELL_SIZE+3); }
    ctx.restore();
  }, [tempTh, canMin, canMax, impTh, showRef, showTracts]);

  const onMove = (ev) => {
    const rect = canvasRef.current.getBoundingClientRect();
    const mx = ev.clientX - rect.left, my = ev.clientY - rect.top;
    const col = Math.floor((mx-PADDING)/CELL_SIZE);
    const row = GRID_DATA.grid.nrows-1-Math.floor((my-PADDING)/CELL_SIZE);
    if (row>=0 && row<GRID_DATA.grid.nrows && col>=0 && col<GRID_DATA.grid.ncols) {
      const cell = GRID_DATA.cells.find(c => c.r===row && c.c===col);
      if (cell) {
        const cx = GRID_DATA.grid.xmin+col+0.5, cy = GRID_DATA.grid.ymin+row+0.5;
        let tn = null;
        for (const t of TRACT_DATA) { for (const ring of t.r) { if (pointInRing(cx,cy,ring)) { tn=t.n; break; } } if (tn) break; }
        setHovered({cell, tn, x:mx, y:my}); return;
      }
    }
    setHovered(null);
  };

  const slider = (label, sub, val, set, min, max, step, cls) =>
    e('div', {className:'card'},
      e('div', {className:'card-title'}, label),
      e('div', {className:'card-sub'}, sub),
      e('input', {type:'range', min, max, step, value:val, onChange: ev => set(+ev.target.value)}),
      e('div', {className:cls}, val.toFixed ? (step<1 ? val.toFixed(1) : val+'') + (cls==='val-temp'?' °F':'%') : val)
    );

  const check = (label, val, set) =>
    e('label', {className:'chk-row'},
      e('input', {type:'checkbox', checked:val, onChange: ev => set(ev.target.checked)}), label);

  const legendItem = (color, text, border) =>
    e('div', {className:'legend-item'},
      e('div', {className:'legend-swatch', style:{backgroundColor:color, border: border||'none'}}), text);

  const statBox = (color, num, label) =>
    e('div', {className:'stat-box', style:{borderColor:color}},
      e('div', {className:'stat-num', style:{color}}, num),
      e('div', {className:'stat-label'}, label));

  return e('div', null,
    e('div', {className:'header'},
      e('h1', null, 'Memphis Urban Heat × Canopy × Impervious Surface Explorer'),
      e('p', null, 'Kwon GIS Lab — University of Memphis')),
    e('div', {className:'wrap'},
      e('div', {className:'desc'}, 'Identify priority intervention zones where high afternoon temperatures, intermediate tree canopy, and high impervious surface overlap—the greatest opportunity for strategic urban forestry investment.'),
      e('div', {className:'layout'},
        e('div', {className:'controls'},
          slider('Temperature Threshold', 'Cells ABOVE this value', tempTh, setTempTh, 93, 99, 0.1, 'val-temp'),
          e('div', {className:'card'},
            e('div', {className:'card-title'}, 'Tree Canopy Cover'),
            e('div', {className:'card-sub'}, 'Cells WITHIN this range'),
            e('div', null,
              e('span', {style:{fontSize:'0.75rem',color:'#6b7280'}}, 'Min'),
              e('input', {type:'range', min:0, max:100, step:1, value:canMin, onChange: ev => setCanMin(Math.min(+ev.target.value, canMax))}),
              e('span', {className:'val-green'}, canMin+'%')),
            e('div', {style:{marginTop:'0.5rem'}},
              e('span', {style:{fontSize:'0.75rem',color:'#6b7280'}}, 'Max'),
              e('input', {type:'range', min:0, max:100, step:1, value:canMax, onChange: ev => setCanMax(Math.max(+ev.target.value, canMin))}),
              e('span', {className:'val-green'}, canMax+'%'))),
          slider('Impervious Surface', 'Cells ABOVE this value', impTh, setImpTh, 0, 100, 1, 'val-dark'),
          e('div', {className:'card'},
            e('div', {className:'card-title'}, 'Map Layers'),
            check('Census tract boundaries', showTracts, setShowTracts),
            e('div', {style:{height:4}}),
            check('Highways, river & grid', showRef, setShowRef),
            e('div', {style:{fontSize:'0.75rem',color:'#9ca3af',marginTop:'0.5rem'}}, '235 Shelby County census tracts')),
          e('div', {className:'stats-card'},
            e('div', {className:'card-title'}, 'Matching Cells'),
            e('div', {className:'stats-grid'},
              statBox('#dc2626', stats.a3, 'All 3'),
              statBox('#ea580c', stats.tc, 'Temp+Canopy'),
              statBox('#7c3aed', stats.ti, 'Temp+Imperv'),
              statBox('#2563eb', stats.ci, 'Canopy+Imperv')))),
        e('div', null,
          e('div', {className:'map-card'},
            e('div', {className:'map-title'}, '1 km² Fishnet Grid — Shelby County Census Tracts'),
            e('div', {className:'canvas-wrap'},
              e('canvas', {ref:canvasRef, onMouseMove:onMove, onMouseLeave:()=>setHovered(null)}),
              hovered && e('div', {className:'tooltip', style:{left:hovered.x+12, top:hovered.y+12}},
                e('div', null, e('strong',null,'Grid: '), 'Row '+hovered.cell.r+', Col '+hovered.cell.c),
                hovered.tn && e('div', null, e('strong',null,'Census Tract: '), hovered.tn),
                e('div', {className:'sep'},
                  e('div', null, e('strong',null,'Temp: '), hovered.cell.t!=null ? hovered.cell.t.toFixed(1)+' °F' : 'N/A'),
                  e('div', null, e('strong',null,'Canopy: '), hovered.cell.cn!=null ? hovered.cell.cn.toFixed(1)+'%' : 'N/A'),
                  e('div', null, e('strong',null,'Imperv: '), hovered.cell.im!=null ? hovered.cell.im.toFixed(1)+'%' : 'N/A')))),
            e('div', {className:'legend'},
              legendItem('#dc2626','All 3 criteria'),
              legendItem('#ea580c','Temp+Canopy'),
              legendItem('#7c3aed','Temp+Imperv'),
              legendItem('#2563eb','Canopy+Imperv'),
              legendItem('#d1d5db','No match'),
              legendItem('#fff','No data','1px solid #d1d5db')))))));
}

ReactDOM.render(e(App), document.getElementById('root'));
</script>
</body>
</html>
